n", "high_resolution"], "media_queries": {"xs": {"width": 572, "media": "(max-width: 575.98px)"}, "sm": {"width": 540, "media": "(min-width: 576px) and (max-width: 767.98px)"}, "md": {"width": 720, "media": "(min-width: 768px) and (max-width: 991.98px)"}, "lg": {"width": 480, "media": "(min-width: 992px) and (max-width: 1199.98px)"}, "xl": {"width": 570, "media": "(min-width: 1200px)"}}}, "pk": 385}, []]]], ["TextPlugin", {"body": "<h3>Superchared Sound</h3>\\n\\n<p>Call them what you want - in-ears, in-ear-monitors or inter aurals - these tiny earbuds are among the most common gadgets around. The most obvious upgrade for anyone with a smartphone whose bundled in-ears are about as dynamic as George Osborne, a good pair of earbuds can take tunes to a higher level for relatively low spend.</p>\\n\\n<p>We've included models from across the range of current selling prices, of course, though there are obvious differences. Pricier pairs generally offer more detail, range and bass, and better noise isolation (handy on trains and possibly even planes).</p>\\n\\n<p>Almost all now include an in-line remote for tweaking volume, changing tracks and hands-free calling, though most are primed for iOS devices. The remote button sometimes works with Android phones, but the volume keys don't. Almost all models come with a choice of tips, where which one you choose is crucial for sound quality, noise isolation and comfort, so don't be afraid to ditch those default tips.</p>", "pk": 386}, []]]], ["BootstrapColumnPlugin", {"glossary": {"xs-column-width": "col-12", "sm-column-width": "", "md-column-width": "", "lg-column-width": "col-lg-6", "xl-column-width": "", "xs-column-offset": "", "sm-column-offset": "", "md-column-offset": "", "lg-column-offset": "", "xl-column-offset": "", "xs-column-ordering": "", "sm-column-ordering": "", "md-column-ordering": "", "lg-column-ordering": "", "xl-column-ordering": "", "xs-responsive-utils": "", "sm-responsive-utils": "", "md-responsive-utils": "", "lg-responsive-utils": "", "xl-responsive-utils": "", "hide_plugin": "", "container_max_widths": {"xs": 282.5, "md": 374.17, "sm": 282.5, "lg": 457.5}}, "pk": 387}, [["ShopAddToCartPlugin", {"glossary": {"use_modal_dialog": "", "hide_plugin": ""}, "pk": 388}, []]]]]]]]]}	2020-05-17 20:18:12.637507+02	\N	\N
27	sennheiser-hd630vb	{"plugins": [["BootstrapContainerPlugin", {"glossary": {"breakpoints": ["xs", "sm", "md", "lg", "xl"], "fluid": "", "hide_plugin": ""}, "pk": 457}, [["BootstrapRowPlugin", {"glossary": {"extra_css_classes": [], "extra_inline_styles:Margins": {"margin-top": "", "margin-bottom": ""}, "extra_inline_styles:background-color": ["disabled", "#ffffff"], "extra_inline_styles:Paddings": {"padding-right": "", "padding-left": ""}}, "pk": 458}, [["BootstrapColumnPlugin", {"glossary": {"xs-column-width": "col-12", "sm-column-width": "", "md-column-width": "", "lg-column-width": "col-lg-6", "xl-column-width": "", "xs-column-offset": "", "sm-column-offset": "", "md-column-offset": "", "lg-column-offset": "", "xl-column-offset": "", "xs-column-ordering": "", "sm-column-ordering": "", "md-column-ordering": "", "lg-column-ordering": "", "xl-column-ordering": "", "xs-responsive-utils": "", "sm-responsive-utils": "", "md-responsive-utils": "", "lg-responsive-utils": "", "xl-responsive-utils": "", "hide_plugin": "", "container_max_widths": {"xs": 345.0, "md": 455.0, "sm": 345.0, "lg": 555.0}}, "pk": 459}, [["CustomSnippetPlugin", {"glossary": {"render_template": "shop/catalog/product-heading.html"}, "pk": 460}, []], ["TextPlugin", {"body": "<h3>Closed Back Headphones with Smartphone Mic &amp; Controls</h3>\\n\\n<p>Sennheiser HD630VB with variable bass deliver amazing performance and a host of features not normally found on audiophile headphones in portable form. The cutting-edge transducers provide clear, powerful sound reproduction, allowing you to hear the subtle nuances of your favourite music recordings. Its innovative rotary bass dial integrated in the ear cup lets you decide how powerful the deep end of sound shall be. With a very wide frequency response the headphones are ideal for listening to high resolution files allowing the HD630VB to redefine audiophile listening for years to come.</p>\\n\\n<p>Sennheiser's HD630VB offers an audiophile listening experience, with the bass sound and control that listeners demand. Bass can be adjusted through a rotary dial on the earcup, and with the touch of a button you can adjust the volume, select a track or make and take calls via the inline microphone on most smartphones. A switch on the controls optimises Apple/Android compatibility with the HD630VB. Crafted from premium materials including strong, lightweight aluminium ear cups, yokes and sliders. The adjustable headband makes it easy to achieve the perfect fit, while soft earpads make even longer periods of listening comfortable. Redefining audiophile listening.</p>\\n\\n<p>Sennheiser HD630VB Portable Audiophile Sound High-definition stereo sound is no longer confined only to home listening, Sennheiser HD630VB embodies audiophile characteristics sonically and technically but with collapsible design made of sturdy, high-quality materials. Take your sound with you wherever you go or connect to your audiophile home stereo equipment. Rotary Bass Adjustment Sennheiser HD630VB gives you perfect bass control. Its innovative rotary bass dial integrated in the ear cup lets you decide how powerful the deep end of sound shall be. Whatever your taste in bass is, with the Sennheiser HD630VB you get what you want.</p>\\n\\n<p>Mobile Device Control A wide range of control functions on the ear cup make it is easy to get the most out of mobile devices. With the touch of a button you can adjust the volume, select a track or make and take calls via the inline microphone. The controls on the right ear cup include music/call controls, and an iOS / Android switch to optimise its control compatibility with most popular mobile phones.</p>\\n\\n<p>Durable Material Crafted from premium materials including strong, lightweight aluminum ear cups, yokes, and sliders the Sennheiser HD630VB is made for a lifetime of use. Its well-cushioned removable and exchangeable earpads and the adjustable headband provide great wearing comfort even on your longest of audiophile journeys.</p>", "pk": 461}, []]]], ["BootstrapColumnPlugin", {"glossary": {"xs-column-width": "col-12", "sm-column-width": "", "md-column-width": "", "lg-column-width": "col-lg-6", "xl-column-width": "", "xs-column-offset": "", "sm-column-offset": "", "md-column-offset": "", "lg-column-offset": "", "xl-column-offset": "", "xs-column-ordering": "", "sm-column-ordering": "", "md-column-ordering": "", "lg-column-ordering": "", "xl-column-ordering": "", "xs-responsive-utils": "", "sm-responsive-utils": "", "md-responsive-utils": "", "lg-responsive-utils": "", "xl-responsive-utils": "", "hide_plugin": "", "container_max_widths": {"xs": 345.0, "md": 455.0, "sm": 345.0, "lg": 555.0}}, "pk": 462}, [["BootstrapImagePlugin", {"glossary": {"hide_plugin": false, "product": null, "link_type": "", "cms_page": null, "section": "", "download_file": null, "ext_url": "", "mail_to": "", "link_target": "", "link_title": "", "image_shapes": ["img-fluid"], "image_width_responsive": "100%", "image_width_fixed": "", "image_height": "", "resize_options": ["subject_location", "high_resolution"], "image_alignment": "", "image_file": {"model": "filer.image", "pk": 110}, "image_title": "", "alt_tag": "", "_image_properties": {"width": 800, "height": 800, "exif_orientation": 1}, "column_bounds": {"min": 320.0, "max": 720.0}, "media_queries": {"xs": "(max-width: 575.98px) 572.00px", "sm": "(min-width: 576px) and (max-width: 767.98px) 540.00px", "md": "(min-width: 768px) and (max-width: 991.98px) 720.00px", "lg": "(min-width: 992px) and (max-width: 1199.98px) 480.00px", "xl": "(min-width: 1200px) 570.00px"}}, "pk": 463}, []], ["ShopAddToCartPlugin", {"glossary": {"use_modal_dialog": "on", "hide_plugin": ""}, "pk": 464}, []]]]]]]]]}	2020-05-17 20:18:12.637507+02	\N	\N
