11	de	<p>Kaffee Espresso Organico</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Kräftige Französische Espresso Röstung: Stärke 4 von 5</li>\n\t<li>Aromen nach Rohkakao und Bitterschokolade, leicht herb, Nuancen von der Dörrpflaume, langanhaltend im Abgang</li>\n\t<li>Geeignet für alle gängigen Kaffeepadmaschinen</li>\n\t<li>Einzelportionen à ca. 7 g</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Das südliche Bergland Mexikos ist Heimat des Kaffee Orgánicos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kaffeegärten werden sorgfältig von indianischen Kleinbäuer*innen gepflegt. Ihr Wissen über den biologischen Anbau und ihr erfahrener, achtsamer Umgang mit der Natur lassen Besonderes reifen: Feuerrote Kirschen - von Hand geerntet, gewaschen, vom Fruchtfleisch befreit, an der Sonne getrocknet, Bohne für Bohne verlesen.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffee geröstet &amp; gemahlen</p>	12	\N
12	de	<p>Kaffee Organico mild</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Besonders milder Kaffee aus Mexico</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 2 von 5</li>\n\t<li>Würzig feines Mandel-Karamell Aroma mit Nuancen von Sternfrucht</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Das südliche Bergland Mexikos ist Heimat des Kaffee Orgánicos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kaffeegärten werden sorgfältig von indianischen Kleinbäuer*innen gepflegt. Ihr Wissen über den biologischen Anbau und ihr erfahrener, achtsamer Umgang mit der Natur lassen Besonderes reifen: Feuerrote Kirschen - von Hand geerntet, gewaschen, vom Fruchtfleisch befreit, an der Sonne getrocknet, Bohne für Bohne verlesen.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>	13	\N
41	de	<p>Schwarztee</p>	<ul class="stwul">\n\t<li>Aromatischer Ceylon-Tee aus Sri Lanka</li>\n\t<li>Mit natürlichem Bergamotte Aroma</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Kontrolliert biologischer Anbau</li>\n\t<li>Nachhaltige Verpackung</li>\n</ul>	<p>Die Wurzeln dieses aromatischen Hochlandtees liegen in der Zentralregion Sri Lankas, in den Teegärten der Small Organic Farmers Association. Die Kleinbäuer*innen haben sich für biologischen Landbau entschieden. Das Zusammenspiel von Boden und Klima, die sorgfältige Pflege der Büsche, die behutsame Ernte der Blätter sowie die erfahrene Weiterverarbeitung des frischen Blattguts in der Teefabrik von Bio-Foods garantieren besonderen Teegenuss.</p>\n\n<p><strong>Zutaten:</strong><br>\nSchwarztee<br>\nBergamotte Aroma</p>	42	\N
7	de	<p>Kaffee Organico mild</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Besonders milder Kaffee aus Mexico</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 2 von 5</li>\n\t<li>Würzig feines Mandel-Karamell Aroma mit Nuancen von Sternfrucht</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Das südliche Bergland Mexikos ist Heimat des Kaffee Orgánicos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kaffeegärten werden sorgfältig von indianischen Kleinbäuer*innen gepflegt. Ihr Wissen über den biologischen Anbau und ihr erfahrener, achtsamer Umgang mit der Natur lassen Besonderes reifen: Feuerrote Kirschen - von Hand geerntet, gewaschen, vom Fruchtfleisch befreit, an der Sonne getrocknet, Bohne für Bohne verlesen.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>	8	
17	de	<p>Kaffee Nica gehaltvoll</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Gehaltvoller Kaffee aus Nicaragua</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 3 von 5</li>\n\t<li>Aromen nach Haselnuss mit Nuancen von Galgant, leichte Fruchtsäure, kräftiger Körper, würzig aber nicht scharf</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Der Ursprung des Kaffee Nica liegt in Nicaragua. In den Regionen um Boaco, Matagalpa, Nueva Segovia und Jinotega werden auf rund 750 - 1.400 Meter Seehöhe Kaffeesträucher unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt angebaut. Viele der Familien besitzen erst seit der sandinistischen Revolution eigenes Land. Kaffee stellt meist die einzige Verdienstquelle dar. Zur Selbstversorgung pflanzen sie hauptsächlich Mais, Bohnen und Pfefferschoten, für den lokalen Markt auch Bananen, Zitrusfrüchte, Ingwer und Kakao an. Die Bäuerinnen und Bauern leben in abgelegenen Gegenden, in denen vor allem kleinbäuerliche Landwirtschaft ohne Chemieeinsatz betrieben wird.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffee geröstet &amp; gemahlen</p>	18	\N
14	de	<p>Kaffee Organico entkoffeiniert</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Besonders milder Kaffee aus Mexico</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 1 von 5</li>\n\t<li>Würzig feines Mandel-Karamell Aroma mit Nuancen von Sternfrucht</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Die Entkoffeinierung erfolgt mit natürlicher Quellkohlensäure und reinem Wasser. Alle wertvollen Geschmacksbestandteile bleiben dadurch enthalten. Dieses Verfahren (CR3) kommt im Vergleich zu anderen völlig ohne Chemie aus und ist daher für biologischen Kaffee zulässig.</p>\n\n<p>Das südliche Bergland Mexikos ist Heimat des Kaffee Orgánicos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kaffeegärten werden sorgfältig von indianischen Kleinbäuer*innen gepflegt. Ihr Wissen über den biologischen Anbau und ihr erfahrener, achtsamer Umgang mit der Natur lassen Besonderes reifen: Feuerrote Kirschen - von Hand geerntet, gewaschen, vom Fruchtfleisch befreit, an der Sonne getrocknet, Bohne für Bohne verlesen.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffee geröstet, gemahlen &amp; entkoffeiniert</p>	15	\N
15	de	<p>Kaffee Organico entkoffeiniert</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Besonders milder Kaffee aus Mexico</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 1 von 5</li>\n\t<li>Würzig feines Mandel-Karamell Aroma mit Nuancen von Sternfrucht</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Die Entkoffeinierung erfolgt mit natürlicher Quellkohlensäure und reinem Wasser. Alle wertvollen Geschmacksbestandteile bleiben dadurch enthalten. Dieses Verfahren (CR3) kommt im Vergleich zu anderen völlig ohne Chemie aus und ist daher für biologischen Kaffee zulässig.</p>\n\n<p>Das südliche Bergland Mexikos ist Heimat des Kaffee Orgánicos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kaffeegärten werden sorgfältig von indianischen Kleinbäuer*innen gepflegt. Ihr Wissen über den biologischen Anbau und ihr erfahrener, achtsamer Umgang mit der Natur lassen Besonderes reifen: Feuerrote Kirschen - von Hand geerntet, gewaschen, vom Fruchtfleisch befreit, an der Sonne getrocknet, Bohne für Bohne verlesen.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet &amp; entkoffeiniert</p>	16	\N
16	de	<p>Kaffee Pueblo aromareich</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Aromareicher Kaffee aus Guatemala und Honduras</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 3 von 5</li>\n\t<li>Aromen von Malz mit Nuancen von der Vollmilchschokolade, blumig, weicher langanhaltender Abgang</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Das südlich-östliche Bergland Guatemalas und des nordwestlichen Honduras ist Heimat des Kaffee Pueblo. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.200 bis 1.600 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die KleinproduzentInnen haben im durchschnittlich 1 bis 2 Hektar Kaffeegärten. Durch den Zusammenschluss in Kooperativen haben die Bäuer*innen Zugang zu biologischen Düngemitteln, technischen Beratungen und günstigen Krediten. In den Kaffeegärten wachsen neben Kaffee auch Mais, Bohnen, Obst und Gemüse - hauptsächlich für den Eigenbedarf. Einige haben auch Hühner, Schweine, Vieh oder Bienen. Die ProduzentInnen aus Guatemala sind Nachfahren indigener Völker Chortí, Maya Popti und Mam, die auch heute noch ihre eigenen Sprachen sprechen.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>	17	\N
18	de	<p>Kaffee Nica kräftige Röstung</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Gehaltvoller Kaffee aus Nicaragua</li>\n\t<li>Kräftige feinaromatische Wiener Röstung: Stärke 3 von 5</li>\n\t<li>Aromen nach Haselnuss mit Nuancen von Galgant, leichte Fruchtsäure, kräftiger Körper, würzig aber nicht scharf</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Der Ursprung des Kaffee Nica liegt in Nicaragua. In den Regionen um Boaco, Matagalpa, Nueva Segovia und Jinotega werden auf rund 750 - 1.400 Meter Seehöhe Kaffeesträucher unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt angebaut. Viele der Familien besitzen erst seit der sandinistischen Revolution eigenes Land. Kaffee stellt meist die einzige Verdienstquelle dar. Zur Selbstversorgung pflanzen sie hauptsächlich Mais, Bohnen und Pfefferschoten, für den lokalen Markt auch Bananen, Zitrusfrüchte, Ingwer und Kakao an. Die Bäuerinnen und Bauern leben in abgelegenen Gegenden, in denen vor allem kleinbäuerliche Landwirtschaft ohne Chemieeinsatz betrieben wird.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffee geröstet &amp; gemahlen</p>	19	\N
20	de	<p>Kaffee Jambo Espresso</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Kräftiger Espresso-Kaffee aus Uganda</li>\n\t<li>Kräftige Espresso Röstung: Stärke 4 von 5</li>\n\t<li>Aromen von grünen Tee mit Nuancen von Marzipan, angenehm harmonischer milder Körper, langanhaltend im Abgang</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Der Ursprung des Kaffee Jambo liegt in der Bugisu Region im Sironko District im Osten Ugandas am Mount Elgon. Der Kaffee wird in dieser Region auf einer Höhe von 2.500 – 3.500 Meter angebaut. Die Kaffeebäuer*innen sind Angehörige der Bagisu (aus dem Sironko Distrikt) und Bulambuli und Sabiny (aus dem Kapchorwa District). Hauptprobleme in der Region sind die verbreitete Armut, hohe HIV-Rate und Zerstückelung der Parzellen durch das traditionelle Erbrecht. Neben Kaffee bauen die Produzent*innen auf ihren kleinen Parzellen (durchschnittlich 1 – 2 Hektar) Gemüse für den Eigenbedarf und den lokalen Markt an: Bananen, Yams, Yuca, Süßkartoffel, Mais, Bohnen, Tomaten, Melanzani, etc. Der Honig aus der eigenen Bienenzucht wird vor allem lokal vermarktet. Einige Produzent*innen stellen zudem Handwerksprodukte zur Einkommenserzielung her bzw. betreiben Kleinstgewerbe.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffee geröstet &amp; gemahlen</p>	21	\N
22	de	<p>Kaffee Jambo Espresso</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Kräftiger Espresso-Kaffee aus Uganda</li>\n\t<li>Kräftige Espresso Röstung: Stärke 4 von 5</li>\n\t<li>Aromen von grünen Tee mit Nuancen von Marzipan, angenehm harmonischer milder Körper, langanhaltend im Abgang</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Der Ursprung des Kaffee Jambo liegt in der Bugisu Region im Sironko District im Osten Ugandas am Mount Elgon. Der Kaffee wird in dieser Region auf einer Höhe von 2.500 – 3.500 Meter angebaut. Die Kaffeebäuer*innen sind Angehörige der Bagisu (aus dem Sironko Distrikt) und Bulambuli und Sabiny (aus dem Kapchorwa District). Hauptprobleme in der Region sind die verbreitete Armut, hohe HIV-Rate und Zerstückelung der Parzellen durch das traditionelle Erbrecht. Neben Kaffee bauen die Produzent*innen auf ihren kleinen Parzellen (durchschnittlich 1 – 2 Hektar) Gemüse für den Eigenbedarf und den lokalen Markt an: Bananen, Yams, Yuca, Süßkartoffel, Mais, Bohnen, Tomaten, Melanzani, etc. Der Honig aus der eigenen Bienenzucht wird vor allem lokal vermarktet. Einige Produzent*innen stellen zudem Handwerksprodukte zur Einkommenserzielung her bzw. betreiben Kleinstgewerbe.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>	23	\N
23	de	<p>Kaffee Mundo edel</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Edle Mischung aus Mittelamerika</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 3 von 5</li>\n\t<li>Am Gaumen leichte Honignoten, mit Nuancen von Getreide und Nougart, mittlerer Körper, langanhaltender Abgang</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Seinen Ursprung hat der Kaffee Mundo im Bergland Mittelamerikas und Mexikos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kleinbäuer*innen des Kaffee Mundo stammen aus unterschiedlichen Teilen Mittelamerikas und Mexikos. Sie haben unterschiedliche Hintergründe, jedoch auch einige Gemeinsamkeiten. Alle sind in Kooperativen zusammengeschlossen um eine gemeinsame, stärkere Stimme zu haben und mitbestimmen zu können. Außerdem profitieren sie durch den Zusammenschluss von technischen Schulungen und Beratungen sowie einer gemeinschaftlichen Verarbeitung und Vermarktung ihres Kaffees.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffee geröstet &amp; gemahlen</p>	24	\N
24	de	<p>Kaffee Mundo Espresso</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Edle Mischung aus Mittelamerika</li>\n\t<li>Kräftige Espresso Röstung: Stärke 4 von 5</li>\n\t<li>Aromen nach Johannisbeeren, leicht erdig, malzige Noten, leichte Schärfe im Abgang, sehr kräftiger Körper, Geschmack mittellang anhaltend</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Seinen Ursprung hat der Kaffee Mundo Espresso im Bergland Mittelamerikas und Mexikos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kleinbäuer*innen des Kaffee Mundo Espresso stammen aus unterschiedlichen Teilen Mittelamerikas und Mexikos. Sie haben unterschiedliche Hintergründe, jedoch auch einige Gemeinsamkeiten. Alle sind in Kooperativen zusammengeschlossen um eine gemeinsame, stärkere Stimme zu haben und mitbestimmen zu können. Außerdem profitieren sie durch den Zusammenschluss von technischen Schulungen und Beratungen sowie einer gemeinschaftlichen Verarbeitung und Vermarktung ihres Kaffees.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>	25	\N
29	de	<p>Kaffe aus Frauenhand</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Frauenkaffeemischung aus Honduras und Peru</li>\n\t<li>Schonende feinaromatische Italienische Röstung: Stärke 3,5 von 5</li>\n\t<li>Aromen nach schwarzem Tee, Zimt und Jostabeere, sehr langanhaltender Abgang und kräftiger Körper</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Produzentinnenorganisationen</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>\n\n<p>Kaffee Adelante ist der erste Kaffee aus Frauenhand. Kleinbäuerinnen, die sich für Selbstbestimmung und Geschlechtergerechtigkeit einsetzen, werden dadurch gestärkt.</p>	<p>Der Ursprung des Kaffee Adelante liegt in Honduras und Peru. Das Umland von Marcala ist die Kaffeeanbauregion in Honduras und produziert den international anerkannten Hochlandkaffee, bekannt als „Café de Origen Marcala“. Marcala liegt circa 150 km von der Hauptstadt Tegucigalpa entfernt inmitten der Berge im Departement La Paz auf ungefähr 1.300 m Seehöhe. Mit Kaffeebohnen aus dem Bezirk San Ignacio in der Provinz Cajamarca im Norden Perus kommt es zu einer einzigartigen Mischung. Auf einer Höhe von circa 1.400 m inmitten von Nebelwäldern gedeihen aromareiche Kaffeekirschen. Kaffee Adelante wird von Kleinbäuerinnen bezogen, die die Kontrolle über Produktion und Vermarktung des Bio-Kaffees in die eigene Hand genommen haben. Sie setzen sich dafür ein, dass sie anerkannt werden: als Kaffeeproduzentinnen, als gleichberechtigte Partnerinnen in den Familien und als Bürgerinnen in ihrer Gesellschaft.</p>\n\n<p><strong>Dolores Benitez Espinoza</strong> ist Kaffeebäuerin und Mitglied der Frauenkooperative APROLMA in Honduras, deren Kaffee im Kaffee ADELANTE steckt: „Es geht zunächst darum, den Frauen zu vermitteln, dass die Arbeit, die sie verrichten – im Haushalt oder auf dem Feld – einen Wert hat. Sie müssen sich selbst achten und wertschätzen. Dann braucht es die Bereitstellung und den Erwerb von Wissen, um eine starke Organisation aufzubauen. Aber Engagement im sozialen Bereich reicht nicht. Wir müssen auch eine wirtschaftliche Grundlage schaffen. Wir wollen keine Umkehr des Rollenverständnisses zwischen Mann und Frau. Wir wollen, dass Frauen eine faire Chance bekommen, sich am wirtschaftlichen, politischen und sozialen Leben gleichberechtigt zu beteiligen! Dafür setzen wir uns ein.“</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>	30	\N
25	de	<p>Kaffee Mundo edel</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Edle Mischung aus Mittelamerika</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 3 von 5</li>\n\t<li>Am Gaumen leichte Honignoten, mit Nuancen von Getreide und Nougart, mittlerer Körper, langanhaltender Abgang</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Seinen Ursprung hat der Kaffee Mundo im Bergland Mittelamerikas und Mexikos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kleinbäuer*innen des Kaffee Mundo stammen aus unterschiedlichen Teilen Mittelamerikas und Mexikos. Sie haben unterschiedliche Hintergründe, jedoch auch einige Gemeinsamkeiten. Alle sind in Kooperativen zusammengeschlossen um eine gemeinsame, stärkere Stimme zu haben und mitbestimmen zu können. Außerdem profitieren sie durch den Zusammenschluss von technischen Schulungen und Beratungen sowie einer gemeinschaftlichen Verarbeitung und Vermarktung ihres Kaffees.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>	26	\N
26	de	<p>Spezialität aus Äthiopien</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Besondere Mischung aus Äthiopien</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 3,5 von 5</li>\n\t<li>Sehr angenehmer und weicher süffiger Körper, harmonische Aromen nach Oolong Tee mit Nuancen nach Vanille</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Der Südwesten Äthiopiens gilt als Ursprung des Arabica-Kaffees. Die günstigen klimatischen Bedingungen prägen sein besonderes Aroma. Oromia ist der Name der größten Provinz Äthiopiens im südlichen und südwestlichen Äthiopien. Aus dem Bergland Sidamos, einer Provinz Oromias, stammt unser Kaffee Abessa. In Oromia lebt rund ein Viertel der Bevölkerung vom Kaffeeanbau. Sie produzieren mehr als die Hälfte des äthiopischen Kaffees in überwiegend kleinbäuerlicher Produktion. Die Produzent*innen des Kaffee Abessa sind im Dachverband der Oromia Union vereinigt. Sie sind allesamt Kleinproduzent*innen mit durchschnittlich 0,5 bis 2 Hektar Land. Die Kaffeeanbauflächen befinden sich auf einer Höhe von 1.500 – 2.000 m in unmittelbarer Nähe der letzten Bergwälder. Kaffee ist die wichtigste Einnahmequelle und gedeiht meist in Mischanbau mit Bananen und anderen Obstbäumen, die den Kaffeepflanzen als Schattenspender dienen. Zusätzlich werden Gewürze, Getreide, Mais, Hirse und Bohnen angebaut, die vor allem der Grundversorgung der Familien dienen.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>	27	\N
27	de	<p>Kaffe aus Frauenhand</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Frauenkaffeemischung aus Honduras und Peru</li>\n\t<li>Schonende feinaromatische Italienische Röstung: Stärke 3,5 von 5</li>\n\t<li>Aromen nach schwarzem Tee, Zimt und Jostabeere, sehr langanhaltender Abgang und kräftiger Körper</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Produzentinnenorganisationen</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>\n\n<p>Kaffee Adelante ist der erste Kaffee aus Frauenhand. Kleinbäuerinnen, die sich für Selbstbestimmung und Geschlechtergerechtigkeit einsetzen, werden dadurch gestärkt.</p>	<p>Der Ursprung des Kaffee Adelante liegt in Honduras und Peru. Das Umland von Marcala ist die Kaffeeanbauregion in Honduras und produziert den international anerkannten Hochlandkaffee, bekannt als „Café de Origen Marcala“. Marcala liegt circa 150 km von der Hauptstadt Tegucigalpa entfernt inmitten der Berge im Departement La Paz auf ungefähr 1.300 m Seehöhe. Mit Kaffeebohnen aus dem Bezirk San Ignacio in der Provinz Cajamarca im Norden Perus kommt es zu einer einzigartigen Mischung. Auf einer Höhe von circa 1.400 m inmitten von Nebelwäldern gedeihen aromareiche Kaffeekirschen. Kaffee Adelante wird von Kleinbäuerinnen bezogen, die die Kontrolle über Produktion und Vermarktung des Bio-Kaffees in die eigene Hand genommen haben. Sie setzen sich dafür ein, dass sie anerkannt werden: als Kaffeeproduzentinnen, als gleichberechtigte Partnerinnen in den Familien und als Bürgerinnen in ihrer Gesellschaft.</p>\n\n<p><strong>Dolores Benitez Espinoza</strong> ist Kaffeebäuerin und Mitglied der Frauenkooperative APROLMA in Honduras, deren Kaffee im Kaffee ADELANTE steckt: „Es geht zunächst darum, den Frauen zu vermitteln, dass die Arbeit, die sie verrichten – im Haushalt oder auf dem Feld – einen Wert hat. Sie müssen sich selbst achten und wertschätzen. Dann braucht es die Bereitstellung und den Erwerb von Wissen, um eine starke Organisation aufzubauen. Aber Engagement im sozialen Bereich reicht nicht. Wir müssen auch eine wirtschaftliche Grundlage schaffen. Wir wollen keine Umkehr des Rollenverständnisses zwischen Mann und Frau. Wir wollen, dass Frauen eine faire Chance bekommen, sich am wirtschaftlichen, politischen und sozialen Leben gleichberechtigt zu beteiligen! Dafür setzen wir uns ein.“</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffee geröstet &amp; gemahlen</p>	28	\N
