31	de	<p>Klimakaffee</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Klimaprämie fördert Wiederaufforstung (Mexiko) &amp; die Errichtung von Holzsparöfen (Uganda)</li>\n\t<li>Klimakaffee aus Mexiko und Uganda</li>\n\t<li>CO2-neutral geröstet: Stärke 3 von 5</li>\n\t<li>Voller Geschmack mit fruchtiger Note und kräftigem Körper</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Produzent*innenorganisationen</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Der COFFEE FOR FUTURE verbindet biofairen Arabica Hochlandkaffee von Kleinbauerngenossenschaften in Mexiko und Uganda mit zusätzlichen Klimaschutzmaßnahmen, die aus einer EZA-Klimaschutzprämie finanziert werden.</p>\n\n<p>Die Mitglieder der mexikanischen Kleinbauernorganisation SPOSEL kultivieren ihre Kaffeesträucher unter Schattenbäumen, eingebettet in die natürliche Umgebung der Selva Lacandona, einem artenreichen Urwaldgebiet. Die Kleinbauernfamilien stärken die Artenvielfalt durch sorgfältige Pflege ihrer Bio-Kaffeeparzellen und durch Wiederaufforstung. Sie tragen so zum Schutz des sensiblen Ökosystems bei.</p>\n\n<p>Auch die Genossenschaft BOCU aus Uganda am Fuß des Rwenzori-Gebirges setzt sich für einen achtsamen Umgang mit den natürlichen Ressourcen ein. Bio-Landbau ist dafür die Basis. Zusätzlich engagiert sich die Kooperative für den Bau von Holzsparöfen. Das nützt besonders Frauen und Kindern. Zum Kochen wird dadurch deutlich weniger Holz benötigt und es entsteht weniger Rauch. Das ist nicht nur besser fürs Klima, sondern schützt auch die Gesundheit der Keinbauernfamilien.</p>\n\n<p>Beide hochwertigen Kaffeesorten ergeben zusammen COFFEE FOR FUTURE: biologisch angebaut, fair gehandelt und von EZA Fairer Handel direkt importiert. Durch die direkte Zusammenarbeit mit EZA Fairer Handel profitieren die Kooperativen von Preisen, die mehr als doppelt so hoch sind wie der aktuelle Weltmarktpreis für Arabica-Hochlandkaffeees.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffee geröstet &amp; gemahlen</p>	32	\N
