40	de	<p>Schwarztee</p>	<ul class="stwul">\n\t<li>Schwarzteemischung mit Tee aus Indien und Sri Lanka</li>\n\t<li>Im Verhältnis 60% Darjeeling und 40% Ceylon</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Produzent*innenorganisationen</li>\n\t<li>Kontrolliert biologischer Anbau</li>\n\t<li>Nachhaltige Verpackung</li>\n</ul>	<p>Die Wurzeln dieses aromatischen Hochlandtees liegen in ausgewählten Bio-Teegärten der Zentralregion Sri Lankas und im nordindischen Darjeeling. Er entsteht im Zusammenspiel von Boden und Klima, sorgfältiger Pflege der Büsche, behutsamer Ernte der Blätter sowie erfahrener Weiterverarbeitung und Mischung. Fairer Handel leistet einen Beitrag, dass sich die Lebens- und Arbeitsbedingungen der Kleinbauernfamilien, Teepflücker*innen und Teearbeiter*innen verbessern. So verbindet sich die Achtung der Menschen und der Natur zu echtem Teegenuss.</p>\n\n<p><strong>Zutaten:</strong><br>\nSchwarztee</p>	41	\N
