54	de	<p>Rotbusch, Hibiskus &amp; Minze</p>	<ul>\n\t<li>Fruchtiger Rotbuschtee aus Südafrika</li>\n\t<li>Hibiskus, Pfefferminze, Zimt und Zitronengras aus Vietnam &amp; Ägypten</li>\n\t<li>Besonders aromatischer Tee aus kontrolliert biologischem Anbau</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Produzent*innenorganisationen</li>\n</ul>	<p>Der einzige Ort der Erde, an dem Rotbusch (Rooibos) gedeiht, ist das Winterregengebiet des südafrikanischen Kaplandes. Kleinbäuer*innen aus der Region Wupperthal pflegen das immergrüne Gebüsch und ernten die feinen nadelartigen Blätter. Sie achten auf die Natur und arbeiten im Einklang mit den Kriterien des biologischen Landbaus - genauso wie die Kleinbauernfamilien in Vietnam und Ägypten, die mit Hibiskus, Pfefferminze, Zimt und Zitronengras für eine harmonisch frische Note sorgen. So entsteht ein köstlicher Durstlöscher, der den Menschen und der Natur gut tut.</p>\n\n<p><strong>Zutaten:</strong><br>\nHibiskusblüten<br>\nRotbusch<br>\nZitronengras<br>\nPfefferminze<br>\nCassia Zimt</p>	55	\N
60	de	<p>Vollrohrzucker</p>	<ul>\n\t<li>Naturbelassener Vollrohrzucker aus kontrolliert biologischem Anbau</li>\n\t<li>Unraffiniert und dadurch reich an natürlichen Mineralstoffen</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aus fairem Handel</li>\n</ul>	<p>Sein dunkles Braun und sein kräftig aromatischer Geschmack machen Mascobado zum geschätzten Exoten unter den Rohrzuckerarten. Sein Ursprung liegt auf der philippinischen Insel Panay. Dort kultivieren organisierte Kleinbäuer*innen mit viel Erfahrung und dem Wissen über den biologischen Anbau ihr Zuckerrohr. In intensiver Handarbeit wird es geerntet und in den kleinen Zuckermühlen vor Ort nach jahrhundertealter Tradition weiter verarbeitet. Mit dem Fairen Handel als Partner haben die Zuckerrohrbäuer*innen die Gewissheit, dass sich ihr Aufwand lohnt. Faire Bezahlung und verlässliche Zusammenarbeit gibt ihnen und ihren Kindern eine Zukunft.</p>\n\n<p>Mascobado ist ein nicht raffinierter Vollrohrzucker. Durch das schonende Herstellungsverfahren behält er seine dunkle Farbe, sein volles, karamellartiges Aroma sowie alle wertvollen Mineralstoffe der Pflanze. Der Zuckerrohrsaft wird erhitzt, gefiltert und unter ständigem Rühren abgekühlt bis eine feinkörnige Masse entsteht. Seine Konsistenz ist typisch für das nicht zentrifugierte Naturprodukt. Er eignet sich zum Backen ebenso wie zum manßvollen Süssen von Getränken und Desserts.</p>	61	\N
61	de	<p>Rohrohzucker</p>	<ul>\n\t<li>Rohrohzucker aus kontrolliert biologischem Anbau</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Nachhaltige Verpackung aus Papier</li>\n\t<li>Aus fairem Handel</li>\n</ul>\n\n<p>Die Weltladen Zuckersticks enthalten jeweils 4g Bio Rohrohrzucker. Das bedeutet, dass der Zucker nur ein einziges Mal raffiniert wird. Die natürliche bräunliche Färbung nimmt dadurch leicht ab, bleibt jedoch erhalten. Die Portionen sind ideal für unterwegs oder praktisch als Beigabe zu Heißgetränken für Ihre Gäste und sehen neben jeder Tasse richtig gut aus.</p>	<p>Das Zuckerrohr von Manduvirá stammt ausschließlich aus kontrolliert biologischem Anbau und die Bäuer*innen leben die Prinzipien der Nachhaltigkeit. Um den Boden vital und fruchtbar zu halten werden Kuh- oder Hühnerdung ausgetragen und stickstoffbindende Pflanzen wie Bohnen gepflanzt. Mindestens 7% der Fläche jedes Mitglieds müssen Schutzgebiete bleiben und dürfen nicht bepflanzt werden. Die Mitglieder der Kooperative können zusätzlich ein breites Angebot an Dienstleistungen in Anspruch nehmen: technische Beratung und Schulungen, günstige Kredite, Sparfonds, Vorauszahlungen und kostengünstige medizinische Versorgung.</p>\n\n<p>"Unsere Vision ist es, als Genossenschaft qualitativ hochwertige Dienstleistungen für Kleinerzeuger zu bieten, um ihre Lebensqualität und den Wohlstand der ganzen Gemeinschaft zu verbessern, und die führende Kooperative in der Produktion und Verarbeitung von Bio-Rohrzucker zu sein. Unsere Mission ist die Förderung der ganzheitlichen Entwicklung. Wir bieten eine Reihe von Dienstleistungen und eine ehrliche, transparente und effiziente Verwaltung für das wirtschaftliche und soziale Wohlergehen unserer Mitglieder und der ganzen Gemeindschaft." - Andrés González Aguilera, Geschäftsführer der Manduvirá Cooperative Ltd.</p>\n\n<p> </p>	62	\N
62	de	<p>Vollmilch</p>	<ul>\n\t<li>50 zartschmelzende Schokotäfelchen aus feinster Mascao Bio-Milchschokolade</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Kleinbauerngenossenschaften</li>\n\t<li>Hochwertige Zutaten aus kontrolliert biologischem Anbau</li>\n\t<li>Umweltfreundlich und Ressourcen schonend hergestellt</li>\n\t<li>Veredelt vom Schweizer Chocolatier Bernrain</li>\n\t<li>Besonders lange und schonend conchiert</li>\n\t<li>Frei von Sojalezithin, Emulgatoren und ohne Einsatz von Fremdfetten</li>\n</ul>	<p>Beste Kakaobohnen und wertvolle Kakaobutter aus Lateinamerika treffen in diesen Schoko-Naps auf naturbelassenen Vollrohrzucker aus den Philippinen. Kleinbäuer*innen sichern die hohe Qualität der biologischen Zutaten. Mit dem Fairen Handel als Partner haben die Bäuer*innen die Gewissheit, dass sich ihr Aufwand lohnt. Faire Bezahlung und verlässliche Zusammenarbeit gibt ihnen und ihren Kindern eine Zukunft.</p>\n\n<p>Beim Schweizer Chocolatier Bernrain werden die Zutaten nach besonderer Rezeptur und extra langem Conchieren miteinander verschmolzen. Die Verarbeitung Rohrzuckers bedarf besonders sorgfältiger und aufwändiger Produktionsschritte. Auf Beigabe künstlicher Aromastoffe und Emulgatoren wird verzichtet. Das umfassend ressourcenschonende und nachhaltige Produktionssystem des Chocolatiers ermöglicht eine Minimierung des Energieverbrauchs.<br>\n<br>\n<strong>Zutaten:</strong><br>\nVollrohrzucker <br>\nKakaobutter <br>\nVollmilchpulver <br>\nKakaomasse <br>\nHaselnüsse gemahlen<br>\n<br>\n<strong>Zusatzinfo:</strong><br>\nSpuren von Mandeln  </p>\n\n<p><strong>Nährwerte:</strong><br>\nK-Joule/100g 2.340<br>\nK-Kalorien/100 g 561<br>\nFettgehalt g/100g 37<br>\nDavon gesättigte Fettsäuren g/100 g 22<br>\nKohlenhydrate g/100 g 49<br>\nDavon Zucker g/100 g 48<br>\nEiweiß g/100g 7<br>\nSalz g/100g 0,19</p>	63	\N
59	de	<p>Magerkakaopulver &amp; Rohrzucker</p>	<ul>\n\t<li>Aromatisch feine lateinamerikanische Mischung aus kontrolliert biologischem Anbau</li>\n\t<li>Mit Magerkakaopulver &amp; Rohrzucker</li>\n\t<li>Nachhaltige Papierverpackung</li>\n</ul>\n\n<p>Zubereitung: Einfach 2 bis 3 gehäufte Teelöffel in einem Glas Milch auflösen, umrühren und genießen. Ideal mit kalter oder warmer Milch sowie in Getreidedrinks, Sojadrinks, Reisdrinks und Mandeldrinks.</p>	<p>Die Süße des Rohrzuckers von unseren Produzenten Manduvirá aus Paraguay verbindet sich in der EZA Equita Trinkschokoladenmischung mit dem feinen Aroma von Kakaobohnen von unseren beiden Produzenten CONACADO und COOPROAGRO aus der Dominikanischen Republik. Die Zutaten stammen von Kleinbäuer*innen, die mit viel Erfahrung die hohe Qualität der Zutaten sichern. Dass sie sich für biologischen Anbau entschieden haben, kommt nicht nur der Natur zugute, sondern allen Menschen, die mit dem Produkt zu tun haben: Den Kakaopflanzer*innen ebenso wie den Zuckerrohrbäuer*innen bis hin zu den kleinen und großen Genießer*innen des Löskakaos.</p>\n\n<p>Die Mitglieder von COOPROAGRO profitieren durch den Fairen Handel von zahlreichen Vorteilen wie dem Zugang zu technischer Beratung, Unterstützung bei der Qualitätssicherung, Mitbestimmung bei der Verwendung der FAIRTRADE-Prämie und Zugang zu sozialen Projekten und Programmen sowie Kredit- und Sparprogramme und einen Nothilfefonds. Mit den FAIRTRADE-Prämien wurden in der Vergangenheit vor allem Infrastrukturprojekte finanziert – Straßen- und Brückenbauten, die Stromversorgung in einem der Dörfer, eine Schule saniert bzw. ein Vereinshaus gebaut. Auch der Bau eines Krankenhauses konnte mitunterstützt werden. Aktuell will man mit den Prämien vor allem die Verarbeitungsanlagen verbessern und Maßnahmen zur Qualitätssicherung setzen.</p>\n\n<p>Das Zuckerrohr von Manduvirá stammt ausschließlich aus kontrolliert biologischem Anbau und die Bäuer*innen leben die Prinzipien der Nachhaltigkeit. Um den Boden vital und fruchtbar zu halten werden Kuh- oder Hühnerdung ausgetragen und stickstoffbindende Pflanzen wie Bohnen gepflanzt. Mindestens 7% der Fläche jedes Mitglieds müssen Schutzgebiete bleiben und dürfen nicht bepflanzt werden. Die Mitglieder der Kooperative können zusätzlich ein breites Angebot an Dienstleistungen in Anspruch nehmen: technische Beratung und Schulungen, günstige Kredite, Sparfonds, Vorauszahlungen und kostengünstige medizinische Versorgung.</p>\n\n<p><strong>Zutaten:</strong><br>\nRohrohrzucker<br>\nMagerkakaopulver</p>\n\n<p><strong>Zusatzinfo:</strong><br>\nSpuren von Eiern<br>\nSpuren von Glutenhaltigem Getreide<br>\nSpuren von Lupinen<br>\nSpuren von Milchprodukten<br>\nSpuren von Schalenfrüchte (Nüssen)<br>\nSpuren von Schwefeldioxid und Sulphiten<br>\nSpuren von Sellerie<br>\nSpuren von Sojabohnen</p>\n\n<table border="1" class="bestandteile" style="width: 50%;">\n\t<thead>\n\t\t<tr>\n\t\t\t<th style="text-align: left;">Nährwerte:<br>\n\t\t\tBeschreibung</th>\n\t\t\t<th style="text-align: left;"><br>\n\t\t\tWert</th>\n\t\t</tr>\n\t</thead>\n\t<tbody>\n\t\t<tr>\n\t\t\t<td>K-Joule/100g</td>\n\t\t\t<td>1.590</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>K-Kalorien/100 g</td>\n\t\t\t<td>376</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Fettgehalt g/100g</td>\n\t\t\t<td>2,8</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>davon gesättigte Fettsäuren g/100 g</td>\n\t\t\t<td>1,7</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Kohlenhydrate g/100 g</td>\n\t\t\t<td>78,5</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>davon Zucker g/100 g</td>\n\t\t\t<td>74,8</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Eiweiß g/100g</td>\n\t\t\t<td>5,1</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Salz g/100g</td>\n\t\t\t<td>0,01</td>\n\t\t</tr>\n\t</tbody>\n</table>\n\n<p> </p>	60	
13	de	<p>Kaffee Organico mild</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Besonders milder Kaffee aus Mexico</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 2 von 5</li>\n\t<li>Würzig feines Mandel-Karamell Aroma mit Nuancen von Sternfrucht</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Das südliche Bergland Mexikos ist Heimat des Kaffee Orgánicos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kaffeegärten werden sorgfältig von indianischen Kleinbäuer*innen gepflegt. Ihr Wissen über den biologischen Anbau und ihr erfahrener, achtsamer Umgang mit der Natur lassen Besonderes reifen: Feuerrote Kirschen - von Hand geerntet, gewaschen, vom Fruchtfleisch befreit, an der Sonne getrocknet, Bohne für Bohne verlesen.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffee geröstet &amp; gemahlen</p>	14	\N
19	de	<p>Kaffee Nica gehaltvoll</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Gehaltvoller Kaffee aus Nicaragua</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 3 von 5</li>\n\t<li>Aromen nach Haselnuss mit Nuancen von Galgant, leichte Fruchtsäure, kräftiger Körper, würzig aber nicht scharf</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Der Ursprung des Kaffee Nica liegt in Nicaragua. In den Regionen um Boaco, Matagalpa, Nueva Segovia und Jinotega werden auf rund 750 - 1.400 Meter Seehöhe Kaffeesträucher unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt angebaut. Viele der Familien besitzen erst seit der sandinistischen Revolution eigenes Land. Kaffee stellt meist die einzige Verdienstquelle dar. Zur Selbstversorgung pflanzen sie hauptsächlich Mais, Bohnen und Pfefferschoten, für den lokalen Markt auch Bananen, Zitrusfrüchte, Ingwer und Kakao an. Die Bäuerinnen und Bauern leben in abgelegenen Gegenden, in denen vor allem kleinbäuerliche Landwirtschaft ohne Chemieeinsatz betrieben wird.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>	20	\N
21	de	<p>Kaffee Jambo Espresso</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Kräftiger Espresso-Kaffee aus Uganda</li>\n\t<li>Kräftige Espresso Röstung: Stärke 4 von 5</li>\n\t<li>Aromen von grünen Tee mit Nuancen von Marzipan, angenehm harmonischer milder Körper, langanhaltend im Abgang</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Der Ursprung des Kaffee Jambo liegt in der Bugisu Region im Sironko District im Osten Ugandas am Mount Elgon. Der Kaffee wird in dieser Region auf einer Höhe von 2.500 – 3.500 Meter angebaut. Die Kaffeebäuer*innen sind Angehörige der Bagisu (aus dem Sironko Distrikt) und Bulambuli und Sabiny (aus dem Kapchorwa District). Hauptprobleme in der Region sind die verbreitete Armut, hohe HIV-Rate und Zerstückelung der Parzellen durch das traditionelle Erbrecht. Neben Kaffee bauen die Produzent*innen auf ihren kleinen Parzellen (durchschnittlich 1 – 2 Hektar) Gemüse für den Eigenbedarf und den lokalen Markt an: Bananen, Yams, Yuca, Süßkartoffel, Mais, Bohnen, Tomaten, Melanzani, etc. Der Honig aus der eigenen Bienenzucht wird vor allem lokal vermarktet. Einige Produzent*innen stellen zudem Handwerksprodukte zur Einkommenserzielung her bzw. betreiben Kleinstgewerbe.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>	22	\N
30	de	<p>Geröstet in Italien</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Vollmundige Mischung aus Lateinamerika und Afrika</li>\n\t<li>Kräftige italienische Espresso Röstung: Stärke 4 von 5</li>\n\t<li>Aromen nach Tabak, Bittermandel und Malz, leichte anhaltende Schärfe, langanhaltender Abgang</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Aus vier verschiedenen Ländern und zwei unterschiedlichen Kontinenten setzte sich die anspruchsvolle Espresso Italiano Arabica-Mischung zusammen. Verarbeitet wird 100 Prozent Arabica Hochland-Kaffee von höchster Qualität. Die Kaffeebäuer*innen des Kaffee Espresso Italiano haben unterschiedliche kulturelle Hintergründe. Indianische Kleinbäuer*innen aus Mexiko und Guatemala geben ihre wertvollen Bohnen zusammen mit peruanischen Kaffeebauernfamilien und Angehörige unterschiedlicher Volksgruppen aus Uganda für die Espresso Italiano Mischung. Gemeinsam möchten Sie ihren Kaffee zu fairen Bedingungen vermarkten.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>	31	\N
33	de	<p>Sprühgetrockneter Löskaffee</p>	<ul>\n\t<li>Arabica- Robusta-Mischung aus kontrolliert biologischem Anbau</li>\n\t<li>Hergestellt in Tanzania</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Produzent*innenorganisationen</li>\n\t<li>Nachhaltige Verpackung im Glas</li>\n\t<li>Sprühtrocknungsverfahren</li>\n</ul>	<p>Der Africafe überzeugt durch hervorragende Qualität. Durch die besonders schonende Verarbeitung mithilfe Gefriertrocknung entsteht ein besonders armomatischer Löskaffee. Der Rohkaffee stammt vom Kaffeekooperativen-Verband KCU in Tansania. Dort wird er von Kleinbäuerinnen und Kleinbauern unter Einhaltung des biologischen Anbaus geerntet. KCU vereint über 60.000 Mitglieder aus Kleinbauernfamilien, meist Angehörige der Haya, eines der rund 120 Völker Tansanias. Die kleinbäuerlichen Betriebe der Kagera-Region (durchschnittlich 2,5 ha) dienen fast ausschließlich der Versorgung der Familien und des lokalen Marktes. Es werden vor allem Bananen, Kartoffel, Mais und Bohnen angebaut. Zur Erwirtschaftung von zusätzlichem Einkommen wird zudem Kaffee kultiviert. Die Bäuer*innen verwenden die Erlöse aus dem Kaffeeanbau vor allem für außerordentliche Aufwendungen (Schule, Gesundheit, Vorsorge, etc.). Dank höherer Preise, Beratung, Weiterbildung, Qualitätskontrollen und direkter Vermarktung hat KCU die Einkommen und Lebensbedingungen der Mitglieder über die Jahre deutlich verbessert. Ein Drittel der Produzent*innen sind Frauen.</p>\n\n<p><strong>Zutaten:</strong><br>\nSprühgetrockneter Löskaffee</p>	34	\N
43	de	<p>First Flush</p>	<ul>\n\t<li>Besonders aromatischer Darjeeling-Tee aus kontrolliert biologischem Anbau</li>\n\t<li>Von Hand gepflückt im Samaboeng-Teegarten in Nordindien an den südlichen Ausläufern des Himalaya</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>FTGFOP1 - First Flush</li>\n\t<li>Leicht herb und blumig</li>\n\t<li>Tassenfarbe: Dunkler Bernstein</li>\n\t<li>Verpackung: Handgeschöpftes Papier</li>\n</ul>\n\n<p> </p>\n\n<p>Höchste FTGFOP1 First Flush Qualität: FTG, also Finest Tippy Golden bedeutet, dass der Tee - bis zu 1/4 des Gesamtvolumens - viele feine, helle Spitzen (Tips) enthält. In FOP1 spiegelt sich die Sorgfalt des Pflückens wieder, denn es werden nur die Knospe mit den obersten beiden zarten Blättchen gepflückt, die unteren groben Blätter bleiben am Strauch. Die Zahl Eins wird in Darjeeling für Blätter der höchsten Güteklasse vergeben. Der First Flush beschreibt die erste Pflückungsperiode von Anfang März bis Mitte April. Hierbei werden nur die hellgrünen Blattspitzen geerntet. Dieser Darjeeling besticht daher durch seinen sehr zarten, frisch, blumigen Geschmack. Mit einem FTGFOP1 First Flush-Tee bekommen Sie also einen mit höchster Sorgfalt hergestellten Premiumtee.</p>	<p>Die Wurzeln dieses hocharomatischen, kostbaren Tees liegen an den südlichen Ausläufern des Himalaya im nordindischen Darjeeling. Auf den Plantagen Samabeong, Singell und Selimbong finden die Pflanzen, was sie zum Gedeihen brauchen: Das besondere Klima für Hochlandtee, einen fruchtbaren, biologisch bewirtschafteten Boden und sorgfältige Pflege. Die behutsame Ernte - bei Darjeeling First Flush ist es die erste Pflückung nach dem Winter - sowie die erfahrene Weiterverarbeitung der frischen Blätter in der Teemanufaktur von Tea Promoters India versprechen erlesenen Genuss. Der Faire Handel trägt dazu bei, dass sich die Lebens- und Arbeitsbedingungen der Teepflücker*innen und Teearbeiter*innen verbessern. Sie bestimmen über die Verwendung der Prämie aus Fairem Handel mit. So werden Vorhaben verwirklicht, die den Familien direkt zugute kommen.</p>\n\n<p><strong>Zutaten:</strong><br>\nSchwarztee</p>	44	\N
44	de	<p>Second Flush</p>	<ul>\n\t<li>Würzig, kräftiger Schwarztee aus kontrolliert biologischem Anbau</li>\n\t<li>Von Hand gepflückter Hochlandtee aus der nordindischen Teeregion Assam,von der Banaspaty Plantage</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>TGFOP 1 - Second Flush</li>\n\t<li>Herb-Kräftig, leicht malziges Aroma - Idealer Frühstückstee</li>\n\t<li>Tassenfarbe: Tiefrot</li>\n\t<li>Verpackung: Handgeschöpftes Papier</li>\n</ul>\n\n<p> </p>\n\n<p>Höchste TGFOP1 Second Flush Qualität: TG, also Tippy Golden bedeutet, dass der Tee zahlreiche feine, helle Spitzen (Tips) enthält. In FOP1 spiegelt sich die Sorgfalt des Pflückens wieder, denn es werden nur die Knospe mit den obersten beiden zarten Blättchen gepflückt, die unteren groben Blätter bleiben am Strauch. Die Zahl Eins wird in Assam für Blätter der höchsten Güteklasse vergeben. Der Second Flush wird von Ende Mai bis Anfang Juli geerntet. In dieser Zeit zum Höhepunkt der Vegetationsperiode entfaltet er sein hocharomatisches, vollmundiges Aroma. Mit einem TGFOP1 Second Flush-Tee bekommen Sie also einen mit höchster Sorgfalt hergestellten Premiumtee.</p>	<p>Die Wurzeln dieses ergiebigen Schwarztees liegen im nordindischen Assam, einem traditionellen Teeanbaugebiet. Auf der Banaspaty Plantage finden die Pflanzen, was sie zum Gedeihen brauchen: Das besondere Klima für Hochlandtee, einen fruchtbaren, biologisch bewirtschafteten Boden und sorgfältige Pflege. Die behutsame Ernte – bei Assam Second Flush TGFOP 1 sind es die besten Blätter der zweiten Ernte sowie die erfahrene Weiterverarbeitung in der Teemanufaktur von Tea Promoters India auf Banaspaty versprechen aromatischen Genuss. Der Faire Handel garantiert, dass sich die Lebens- und Arbeitsbedingungen der Teepflückerinnen und Teearbeiter verbessern. Es werden Vorhaben verwirklicht, die den Familien auf Banaspaty direkt zugute kommen.</p>\n\n<p><strong>Zutaten:</strong><br>\nSchwarztee</p>	45	\N
52	de	<p>Rotbuschtee</p>	<ul>\n\t<li>Fruchtiger Rotbuschtee aus Südafrika</li>\n\t<li>Besonders aromatischer Tee aus kontrolliert biologischem Anbau</li>\n\t<li>Von Hand gepflückt im Winterregengebiet des südafrikanischen Kaplandes</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n</ul>	<p>Der einzige Ort der Erde, an dem Rotbusch (Rooibos) gedeiht, ist das Winterregengebiet des südafrikanischen Kaplandes. Kleinbäuer*innen aus der Region Wupperthal pflegen das immergrüne Gebüsch nach den Kriterien des kontrolliert biologischen Landbaus und ernten die feinen nadelartigen Blätter. Vor Ort werden sie sorgfältig weiterverarbeitet - getrocknet, fermentiert und zerkleinert. Fertig ist die Basis für einen köstlichen Durstlöscher, der den Menschen und der Natur gut tut.</p>\n\n<p>Bei den heutigen 62 Mitgliedern (davon 23 Frauen) der Kooperative handelt es sich um Kleinproduzent*innen, die vor allem vom Anbau des Rotbuschtees leben. Dieser stellt das Haupteinkommen der Familien sicher. Zusätzlich begannen einige Mitglieder mit dem Anbau von Bio-Kräutern, um auf diese Weise ihre Produktion und Einkommen zu diversifizieren. Neben Rotbusch und Kräutern werden Produkte für den Eigenbedarf (Gemüse, Obst) angebaut und einige Schafe und Ziegen gehalten.</p>\n\n<p><strong>Zutaten:</strong><br>\nRotbusch</p>	53	\N
58	de	<p>stark entöltes Kakaopulver</p>	<ul>\n\t<li>Aromatisch feine lateinamerikanische Mischung aus kontrolliert biologischem Anbau</li>\n\t<li>Die Standardtemperatur zum Rösten der Kakaobohnen liegt zwischen 115 und 130 Grad</li>\n\t<li>Ohne Zusatz von Zucker oder anderen Süßungsmittel</li>\n\t<li>Kakaobuttergehalt von 10-12%</li>\n\t<li>Nachhaltige Papierverpackung</li>\n</ul>	<p>Mit Sorgfalt, Erfahrung und mit Cariño - Zuneigung - kultivieren die Kleinbäuer*innen in Lateinamerika ihre Kakaobäume. Durch Fairen Handel haben sie die Gewissheit, dass sich ihr Aufwand lohnt. Faire Bezahlung und eine verlässliche Zusammenarbeit geben ihnen und ihren Kindern eine Zukuft und sichern die hohe Qualität ihrer Ernte.</p>\n\n<p><strong>Zutaten:</strong><br>\nKakaopulver stark entölt<br>\nSäureregulator: Kaliumcarbonat</p>\n\n<p> </p>	59	<table border="1" class="bestandteile" style="width: 50%;">\n\t<thead>\n\t\t<tr>\n\t\t\t<th style="text-align: left;">Nährwerte:<br>\n\t\t\tBeschreibung</th>\n\t\t\t<th style="text-align: left;"><br>\n\t\t\tWert</th>\n\t\t</tr>\n\t</thead>\n\t<tbody>\n\t\t<tr>\n\t\t\t<td>K-Joule/100g</td>\n\t\t\t<td>1.289</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>K-Kalorien/100 g</td>\n\t\t\t<td>310</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Salz g/100g</td>\n\t\t\t<td>0,1</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>davon Zucker g/100 g</td>\n\t\t\t<td>0,3</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Eiweiß g/100g</td>\n\t\t\t<td>23,5</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Kohlenhydrate g/100 g</td>\n\t\t\t<td>14</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Fettgehalt g/100g</td>\n\t\t\t<td>11</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>davon gesättigte Fettsäuren g/100 g</td>\n\t\t\t<td>6,9</td>\n\t\t</tr>\n\t</tbody>\n</table>
9	de	<p>Kaffee Espresso Organico</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Kräftige Französische Espresso Röstung: Stärke 4 von 5</li>\n\t<li>Aromen nach Rohkakao und Bitterschokolade, leicht herb, Nuancen von der Dörrpflaume, langanhaltend im Abgang</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Das südliche Bergland Mexikos ist Heimat des Kaffee Orgánicos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kaffeegärten werden sorgfältig von indianischen Kleinbäuer*innen gepflegt. Ihr Wissen über den biologischen Anbau und ihr erfahrener, achtsamer Umgang mit der Natur lassen Besonderes reifen: Feuerrote Kirschen - von Hand geerntet, gewaschen, vom Fruchtfleisch befreit, an der Sonne getrocknet, Bohne für Bohne verlesen.</p>\n\n<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>	10	
